import styled from 'styled-components/native';


export const Container = styled.View`
    flex:1;
    backgroundColor: 	#6495ED;
    alignItems: center;
    justifyContent: center;
`;

export const Texto = styled.Text`
    color: black;
    font-size: 35px;
    marginHorizontal: 15;
    marginBottom: 10;
`;
